import { IOutput } from "./Interface/IOutput"
import { FC, useCallback, useMemo } from "react"
import { IWriteOutput } from "./Interface/IWriteOutput"

export const Output : FC<IOutput> = ({output}) => {
    return (
        <div className='output'>
            { output.map(element => {
            return element.status === 1 ? <div className='error'>{element.line}</div> : <div>{element.line}</div>
        })}
        </div>
    )
}
